import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="main_Box">
        <div className="upper_Image_Box">
          <img src="./img/icon/.svg" alt="icon" className="upperIcon" />
        </div>
      </div>
    </div>
  );
}

export default App;
